PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "inventory_bonentry" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "idBon" varchar(200) NOT NULL UNIQUE, "dateBon" date NOT NULL, "entrepot_id" bigint NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "fournisseur_id" bigint NULL REFERENCES "tiers_fournisseur" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_bonreintegration" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "idBon" varchar(200) NOT NULL UNIQUE, "dateBon" date NOT NULL, "bonRetour_id" bigint NULL REFERENCES "inventory_bonretour" ("id") DEFERRABLE INITIALLY DEFERRED, "entrepot_id" bigint NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_bonsortiedestock" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "idBon" varchar(200) NOT NULL UNIQUE, "dateBon" date NOT NULL, "num_doc" varchar(100) NULL, "Date_doc_Sortie" date NULL, "num_constat" varchar(100) NULL, "Date_constat" date NULL, "note" text NULL, "Client_id" bigint NULL REFERENCES "tiers_client" ("id") DEFERRABLE INITIALLY DEFERRED, "bonL_id" bigint NULL REFERENCES "ventes_bonsortie" ("id") DEFERRABLE INITIALLY DEFERRED, "entrepot_id" bigint NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_entrepot" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "adresse" varchar(100) NULL, "ville" varchar(100) NOT NULL, "codePostal" varchar(100) NULL, "phone" varchar(100) NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_devise" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "reference" varchar(2500) NULL, "designation" varchar(2500) NULL, "symbole" varchar(2500) NULL, "actif" bool NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_journal" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "label" varchar(2500) NULL);
CREATE TABLE IF NOT EXISTS "clientInfo_plancomptableclass" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "clientInfo_store" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NULL, "location" varchar(100) NULL, "code" varchar(100) NULL, "nAdherent" varchar(100) NULL, "denomination" varchar(100) NULL, "raisonSocial" varchar(100) NULL, "address1" varchar(300) NULL, "address2" varchar(300) NULL, "address3" varchar(300) NULL, "CodePostal" varchar(255) NULL, "phone1" varchar(30) NULL, "phone2" varchar(30) NULL, "phone3" varchar(30) NULL, "fax1" varchar(30) NULL, "fax2" varchar(30) NULL, "fax3" varchar(30) NULL, "mobile1" varchar(30) NULL, "mobile2" varchar(30) NULL, "mobile3" varchar(30) NULL, "monnaie" varchar(10) NULL, "IdentificationFis" varchar(50) NULL, "registreCom" varchar(50) NULL, "articleImpo" varchar(50) NULL, "identifiantStatistique" varchar(50) NULL, "banque" varchar(250) NULL, "compteBancaire" varchar(250) NULL, "compteCCP" varchar(250) NULL, "capitaleSocial" varchar(250) NULL, "product_variant" bool NULL);
CREATE TABLE IF NOT EXISTS "clientInfo_valeurdevise" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "valeur" varchar(2500) NULL, "date" date NULL, "Devise_id" bigint NULL REFERENCES "clientInfo_devise" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_typeclient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type_desc" varchar(2500) NULL, "dateCreation" date NULL, "montant_min" decimal NOT NULL, "percent" decimal NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_taxes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "libelle" varchar(2500) NULL, "taux" varchar(2500) NULL, "type_taxe" varchar(30) NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_plancomptableaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(10) NOT NULL, "name" varchar(100) NOT NULL, "comptable_class_id" bigint NOT NULL REFERENCES "clientInfo_plancomptableclass" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "kit" bool NOT NULL, "kitcomponents" text NOT NULL, "LibellÃ©" varchar(100) NOT NULL, "categoryDesc" varchar(250) NULL, "status" bool NOT NULL, "pc_component" varchar(250) NULL, "MotherCategory_id" bigint NULL REFERENCES "produits_category" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "reference" varchar(120) NOT NULL, "name" varchar(200) NULL, "prix_vente" decimal NOT NULL, "prix_vente_pc" decimal NOT NULL, "prix_vente_kit" decimal NOT NULL, "prix_achat" decimal NOT NULL, "prix_livraison" decimal NOT NULL, "tva" decimal NOT NULL, "tva_douan" decimal NOT NULL, "marge" decimal NOT NULL, "initial_qte" integer NOT NULL, "QuantityPerCarton" integer NOT NULL, "TotalQte" integer NOT NULL, "reforme" bool NOT NULL, "fournisseur" varchar(100) NOT NULL, "category_id" bigint NULL REFERENCES "produits_category" ("id") DEFERRABLE INITIALLY DEFERRED, "parent_product_id" bigint NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_variantes_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "variant_lib" varchar(100) NOT NULL, "values_list" varchar(25) NOT NULL);
CREATE TABLE IF NOT EXISTS "produits_verificationarchive" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "codeArchive" varchar(255) NOT NULL, "date_verification" datetime NOT NULL, "entrepot_id" bigint NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_variantsprixclient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "prix_vente" decimal NOT NULL, "prix_vente_pc" decimal NOT NULL, "prix_vente_kit" decimal NOT NULL, "prix_vente_carton" decimal NOT NULL, "produit_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED, "type_client_id" bigint NOT NULL REFERENCES "clientInfo_typeclient" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_promotion" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "prix_vente" decimal NOT NULL, "prix_vente_pc" decimal NOT NULL, "prix_vente_kit" decimal NOT NULL, "prix_vente_carton" decimal NOT NULL, "start_date" date NOT NULL, "end_date" date NOT NULL, "product_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED, "type_client_id" bigint NOT NULL REFERENCES "clientInfo_typeclient" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_productvariant" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "value" varchar(10) NOT NULL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "reference" varchar(50) NOT NULL UNIQUE, "product_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED, "variant_id" bigint NULL REFERENCES "produits_variantes_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_numseries" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "numseries" varchar(250) NOT NULL, "used" bool NOT NULL, "produit_id" bigint NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_listproductverificationarchive" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_reference" varchar(255) NOT NULL, "realQuantity" integer unsigned NOT NULL CHECK ("realQuantity" >= 0), "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "verification_result" varchar(255) NOT NULL, "verification_id" bigint NOT NULL REFERENCES "produits_verificationarchive" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_historiqueachatproduit" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "qty_qctuelle" integer NOT NULL, "prix_achat_actuelle" decimal NOT NULL, "qty_achete" integer NOT NULL, "prix_achat" decimal NOT NULL, "prix_achat_calcule" decimal NOT NULL, "dateAchat" date NOT NULL, "produit_id" bigint NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_historique_prix_achat" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "version" integer NOT NULL, "prix_achat_original" decimal NOT NULL, "prix_achat_newer" decimal NOT NULL, "product_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "produits_codeea" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(250) NOT NULL, "produit_id" bigint NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_stock" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "quantity_initial" integer unsigned NOT NULL CHECK ("quantity_initial" >= 0), "quantity_pc" integer unsigned NOT NULL CHECK ("quantity_pc" >= 0), "quantity_kit" integer unsigned NOT NULL CHECK ("quantity_kit" >= 0), "quantity_blocked" integer unsigned NOT NULL CHECK ("quantity_blocked" >= 0), "entrepot_id" bigint NOT NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbontransfertmag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bontransfertmagasin" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_arr_id" bigint NOT NULL REFERENCES "inventory_stock" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_dep_id" bigint NOT NULL REFERENCES "inventory_stock" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbontransfert" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bontransfert" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_arr_id" bigint NOT NULL REFERENCES "inventory_stock" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_dep_id" bigint NOT NULL REFERENCES "inventory_stock" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonsortiestock" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonsortiedestock" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonretourancien" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "referenceproduit" varchar(100) NOT NULL, "nomproduit" varchar(100) NOT NULL, "totalprice" decimal NOT NULL, "unitprice" decimal NOT NULL, "reintegrated" bool NOT NULL, "image" varchar(100) NOT NULL, "warranty" bool NOT NULL, "numseries" varchar(200) NULL, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonretourancien" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonretour" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "totalprice" decimal NOT NULL, "unitprice" decimal NOT NULL, "reintegrated" bool NOT NULL, "image" varchar(100) NOT NULL, "warranty" bool NOT NULL, "numseries" varchar(200) NULL, "direction" varchar(50) NULL, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonretour" ("id") DEFERRABLE INITIALLY DEFERRED, "produit_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonreintegration" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonreintegration" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonreforme" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "observation" text NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonreforme" ("id") DEFERRABLE INITIALLY DEFERRED, "produit_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonmaintenance" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "image1" varchar(100) NOT NULL, "image2" varchar(100) NOT NULL, "image3" varchar(100) NOT NULL, "image4" varchar(100) NOT NULL, "quantity" integer NOT NULL, "observation" text NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonmaintenance" ("id") DEFERRABLE INITIALLY DEFERRED, "produit_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonentry" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonentry" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produitsenbonechange" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "unitprice" decimal NOT NULL, "totalprice" decimal NOT NULL, "BonNo_id" bigint NOT NULL REFERENCES "inventory_bonechange" ("id") DEFERRABLE INITIALLY DEFERRED, "stock_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_produiteninventaireannuel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "Equipe_id" bigint NOT NULL REFERENCES "inventory_equipeinventaire" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "produits_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_inventaireannuel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "codeInv" varchar(100) NOT NULL, "dateInv" date NOT NULL, "datecloture" date NOT NULL, "note" text NOT NULL, "entrepot_id" bigint NOT NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NOT NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_equipeinventaire" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "label_equipe" text NOT NULL, "inv_annuel_id" bigint NOT NULL REFERENCES "inventory_inventaireannuel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "inventory_bontransfertmagasin" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "idBon" varchar(200) NOT NULL UNIQUE, "dateBon" date NOT NULL, "automatiquement" bool NULL, "valide" bool NULL, "entrepot_arrive_id" bigint NOT NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "entrepot_depart_id" bigint NOT NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "store_arrive_id" bigint NOT NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "store_depart_id" bigint NOT NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_agence" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(2500) NULL, "adresse" varchar(2500) NULL, "actif" bool NOT NULL, "banque_id" bigint NULL REFERENCES "tiers_banque" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_banque" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nom" varchar(2500) NULL, "code" varchar(2500) NULL, "bic" varchar(2500) NULL, "actif" bool NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_client" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "adresse" varchar(250) NOT NULL, "phone" varchar(150) NOT NULL, "email" varchar(150) NOT NULL, "sourceClient" varchar(150) NOT NULL, "registreCommerce" varchar(150) NOT NULL, "Nif" varchar(150) NOT NULL, "Nis" varchar(150) NOT NULL, "num_article" varchar(150) NOT NULL, "region_client" varchar(150) NOT NULL, "solde" decimal NOT NULL, "valide" bool NOT NULL, "NisDoc" varchar(100) NOT NULL, "NifDoc" varchar(100) NOT NULL, "RCDoc" varchar(100) NOT NULL, "AIDoc" varchar(100) NOT NULL, "categorie_client_id" bigint NULL REFERENCES "clientInfo_typeclient" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_comptebancaire" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "labelCompte" varchar(250) NULL, "TypeCompte" text NULL, "compteclient" text NULL, "num_compte" integer NULL, "cle" integer NULL, "IBAN" integer NULL, "Agence_id" bigint NULL REFERENCES "tiers_agence" ("id") DEFERRABLE INITIALLY DEFERRED, "Banque_id" bigint NULL REFERENCES "tiers_banque" ("id") DEFERRABLE INITIALLY DEFERRED, "client_id" bigint NULL REFERENCES "tiers_client" ("id") DEFERRABLE INITIALLY DEFERRED, "fournisseur_id" bigint NULL REFERENCES "tiers_fournisseur" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_fournisseur" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "codeFournisseur" varchar(25) NOT NULL, "acronym" varchar(150) NOT NULL, "raison_Social" varchar(150) NOT NULL, "adresse" varchar(250) NOT NULL, "phone" varchar(150) NOT NULL, "email" varchar(150) NOT NULL, "typefournisseur" varchar(25) NOT NULL, "fournisseurEtrange" bool NOT NULL, "fournisseurClient" varchar(150) NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_prospectionclient" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "SourceClient" varchar(250) NULL, "etatProspection" varchar(250) NULL, "client_id" bigint NULL REFERENCES "tiers_client" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_region" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "label" varchar(250) NULL, "wilayas" text NULL, "date_created" datetime NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiers_tentatives" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "dateDebutTentative" datetime NOT NULL, "dateFinTentative" datetime NOT NULL, "MoyenContact" varchar(250) NULL, "note" varchar(250) NULL, "propspection_id" bigint NULL REFERENCES "tiers_prospectionclient" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NULL REFERENCES "user_customuser" ("user_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "clientInfo_compteentreprise" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nature" varchar(30) NOT NULL, "label" varchar(2500) NULL, "numCompte" varchar(2500) NULL, "journal" varchar(2500) NULL, "monnaie" varchar(2500) NULL, "agence_id" bigint NULL REFERENCES "tiers_agence" ("id") DEFERRABLE INITIALLY DEFERRED, "banque_id" bigint NULL REFERENCES "tiers_banque" ("id") DEFERRABLE INITIALLY DEFERRED, "compteComptable_id" bigint NOT NULL REFERENCES "clientInfo_plancomptableaccount" ("id") DEFERRABLE INITIALLY DEFERRED, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "user_customgroup" ("group_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "label" varchar(100) NOT NULL, "description" text NOT NULL, "store_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "user_customuser" ("user_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "role" varchar(100) NULL, "adresse_ip" char(39) NULL, "EmployeeAt_id" bigint NULL REFERENCES "clientInfo_store" ("id") DEFERRABLE INITIALLY DEFERRED, "entrepots_responsible_id" bigint NULL REFERENCES "inventory_entrepot" ("id") DEFERRABLE INITIALLY DEFERRED, "equipe_affiliated_id" bigint NULL REFERENCES "user_equipe" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NULL REFERENCES "user_customgroup" ("group_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "user_usercustompermission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "view" varchar(50) NULL, "name" varchar(100) NULL, "action" varchar(50) NOT NULL);
